import Pizza from "./Pizza";
import { pizzaData } from "../data/data";

function Menu() {
    return (
        <div className="menu">
            <h2>Our Menu</h2>
            div.pizzaContainer
            <Pizza
                name="Focaccia"
                ingredients="Bread with italian olive oil and rosemary"
                price="6"
                photoName="/assets/images/1.png"
                soldOut="false"
            />
        </div>
    );
}

export default Menu;
